import React, { useState } from 'react';
import './index.css';
import SideBar from './SideBar';
import CompetencesWindow from './Compétences';
import FormationWindow from './Formations';

function DynamicWindow(changePage, setChangePage) {
  if (changePage === 0) {
    return <CompetencesWindow />;
  } else if (changePage === 1) return <FormationWindow />;
}

function Window(changePage, setChangePage) {
  return (
    <div>
      <DynamicWindow />
    </div>
  );
}

export default Window;
